import axios from 'axios';

let photographes = axios.get('https://s3-eu-west-1.amazonaws.com/course.oc-static.com/projects/Front-End+V2/P5+Javascript+%26+Accessibility/FishEyeData.json');

function Photographes() {
    return (
        //Faire une requête axios ici pour récuprérer tous les photographes
        <main>
            <h1>Nos Photographes</h1>
            {/* Faire une boucle foreach pour retourner un composant <Photograph/> pour chaque. */}
            {photographes.map((photograph) => {
                <div className="photograph">
                    <img src={'../assets/'+ photograph.portrait} alt={photograph.name} />
                    <a href="./profile.html">
                        <h2 className="name">{photograph.name}</h2>
                    </a>
                    <p className="location">{photograph.city + ', ' + photograph.country}</p>
                </div>
            })}
        </main>
    )
}

export default Photographes;
